import React from 'react';
import styled from 'styled-components';

import Mapp from './Components/Mapp';
import Side from './Components/Side';

const Container = styled.div`
  display: flex;
`;

function App() {
  return (
    <div className="App">
      <Container>
        <Mapp></Mapp>
        <Side></Side>
      </Container>
    </div>
  );
}

export default App;
